import React from "react";

export const Tile = ({ name, description }) =>
{
  // Directly access phone and email from the description object
  return (
    <div className="tile-container">
      <p className="tile-title">Name: {name}</p>
      <p className="tile">Phone: {description.phone}</p>
      <p className="tile">Email: {description.email}</p>
    </div>
  );
};
